fetch("https://jsonplaceholder.typicode.com/users")
    .then(data => data.json())
    .then(users => {
        this.setState({
            users : users
        })
    })
    .catch(error => {
        console.log(error)
    })

const HomePage = () => {
    return <div>Welcome to Next.js!</div>
}

export default HomePage
